import React from "react";
// imported local files
import Nav from "../components/nav";
import Routes from "../router/routes";
import Guest from "../users/guest";
import Clock from "../users/clock.js";
import "../styles/App.scss";

function App() {
  return (
    <div className='App'>
      <Nav />
      <Routes />
      <Guest />
      <Clock />
    </div>
  );
}
export default App;
